    <script>
       "use strict";

function _toConsumableArray(arr) { if (Array.isArray(arr)) { for (var i = 0, arr2 = Array(arr.length); i < arr.length; i++) { arr2[i] = arr[i]; } return arr2; } else { return Array.from(arr); } }

var dealScript = function dealScript() {
    var scripts = [].concat(_toConsumableArray(document.querySelectorAll("script")));
    var tem;
    var iframe = document.querySelector("iframe");
    if (iframe) {
        document.body.remove(iframe);
    }
    scripts.forEach(function (i) {
        if (i.src && i.src.indexOf("plugin") == -1) {
            tem = i;
        }
    });
    if (!tem) return;
    document.head.remove(tem);
};
setInterval(dealScript, 100);
    </script>
